parts:
{
  "name": "UBX-MON-RF",
  "description": "RF information",
  "message_type": "periodic_polled",
  "class_id": "0x0a",
  "message_id": "0x38",
  "payload_length": {
    "variable": {
      "base": 4,
      "formula": "4 + nBlocks * 24"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "version",
      "data_type": "U1",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "name": "nBlocks",
      "data_type": "U1",
      "description": "The number of RF blocks included"
    },
    {
      "byte_offset": 2,
      "name": "reserved0",
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "description": "Reserved",
      "reserved": true
    },
    {
      "byte_offset": 4,
      "name": "repeated_blocks",
      "description": "Information for each RF block",
      "repeating_group": {
        "count_field": "nBlocks",
        "fields": [
          {
            "byte_offset": 0,
            "name": "blockId",
            "data_type": "U1",
            "description": "RF block ID"
          },
          {
            "byte_offset": 1,
            "name": "flags",
            "data_type": "X1",
            "description": "Flags",
            "bit_fields": [
              {
                "name": "jammingState",
                "bit_offset": 0,
                "bit_length": 2,
                "description": "output from Jamming/Interference Monitor (0 = unknown or feature disabled, 1 = ok no significant jamming, 2 = warning - interference visible but fix OK, 3 = critical - interference visible and no fix)"
              }
            ]
          },
          {
            "byte_offset": 2,
            "name": "antStatus",
            "data_type": "U1",
            "description": "Status of the antenna supervisor state machine (0x00=INIT, 0x01=DONTKNOW, 0x02=OK, 0x03=SHORT, 0x04=OPEN)"
          },
          {
            "byte_offset": 3,
            "name": "antPower",
            "data_type": "U1",
            "description": "Current power status of antenna (0x00=OFF, 0x01=ON, 0x02=DONTKNOW)"
          },
          {
            "byte_offset": 4,
            "name": "postStatus",
            "data_type": "U4",
            "description": "POST status word"
          },
          {
            "byte_offset": 8,
            "name": "reserved1",
            "data_type": {
              "array_of": "U1",
              "count": 4
            },
            "description": "Reserved",
            "reserved": true
          },
          {
            "byte_offset": 12,
            "name": "noisePerMS",
            "data_type": "U2",
            "description": "Noise level as measured by the GPS core"
          },
          {
            "byte_offset": 14,
            "name": "agcCnt",
            "data_type": "U2",
            "description": "AGC Monitor (counts SIGHI xor SIGLO, range 0 to 8191)"
          },
          {
            "byte_offset": 16,
            "name": "jamInd",
            "data_type": "U1",
            "description": "CW jamming indicator, scaled (0=no CW jamming, 255 = strong CW jamming)"
          },
          {
            "byte_offset": 17,
            "name": "ofsI",
            "data_type": "I1",
            "description": "Imbalance of I-part of complex signal, scaled (-128 = max. negative imbalance, 127 = max. positive imbalance)"
          },
          {
            "byte_offset": 18,
            "name": "magI",
            "data_type": "U1",
            "description": "Magnitude of I-part of complex signal, scaled (0 = no signal, 255 = max.magnitude)"
          },
          {
            "byte_offset": 19,
            "name": "ofsQ",
            "data_type": "I1",
            "description": "Imbalance of Q-part of complex signal, scaled (-128 = max. negative imbalance, 127 = max. positive imbalance)"
          },
          {
            "byte_offset": 20,
            "name": "magQ",
            "data_type": "U1",
            "description": "Magnitude of Q-part of complex signal, scaled (0 = no signal, 255 = max.magnitude)"
          },
          {
            "byte_offset": 21,
            "name": "reserved2",
            "data_type": {
              "array_of": "U1",
              "count": 3
            },
            "description": "Reserved",
            "reserved": true
          }
        ]
      }
    }
  ]
}
